import React, {useState} from "react";
import './Profile.css'

function Profile({user}) {
    if (user == null) {
        return (
            <div className="profile">
                <p>Log in to access this feature</p>
            </div>
        )
    }
    else {
        return (
            <div className="profile">

            </div>
        )
    }
}

export default Profile
